import './App.css';
import './assets/Home';

// import ImageSlider from './assets/ImageSlider2/ImageSlider';
import { SliderData } from '../src/assets/ImageSlider2/SliderData';

import {Header, SobreNos, Footer, ImageSlider} from './components/Home/Home';
function App() {
  return (
    <>
      <Header />
      <ImageSlider slides={SliderData} />
      <SobreNos />
      <Footer />
    </>

  );
}
export default App;
